import React from 'react'
import { useAuth } from './auth'
function Profile() {
    const auth = useAuth()
    const handleLogout = ()=>{
        auth.logout()
    }
  return (<>
    <div>Welcom {auth.user}</div>
    <button onClick={handleLogout}>Logout</button>
    </>)
}

export default Profile
